// import { useState } from 'react';
import ScrollToTop from './scrolltotop/scrollToTop';
import { Helmet } from 'react-helmet';
// import Steps from './steps/Steps';
import styled from 'styled-components';
import {Link} from 'react-router-dom';

const DIV = styled.div`
    .black-look{
        text-align: left;
        color: white;
        max-width: 1100px;
        background-color: black;
        border-radius: 50px;
        margin-top: 3px;
        margin-bottom: 50px;
        padding: 50px;
        font-size: 40px;
    }
    .black-look p{
        color: white;
        margin-bottom: 40px;
    }
    #say{
        font-size: 18px;
    }
    #sign-up{
        background: white;
        margin-top: 20px;
        margin-right: 10px;
        border: 1px solid #f1356d;
        padding: 10px;
        border-radius: 40px;
        cursor: pointer;
        font-size: 15px;
        transition: all 0.1s linear;
        color: #f1356d;
    }
    #sign-up:hover{
        background: black;
        border: 1px solid black;
        color: white;
    }
    #log-in{
        background: black;
        margin-top: 20px;
        border: 1px solid black;
        padding: 10px;
        border-radius: 40px;
        cursor: pointer;
        font-size: 15px;
        transition: all 0.1s linear;
        color: white;
    }
    #log-in:hover{
        background: white;
        border: 1px solid black;
        color: black;
    }
`
const Home = () => {
    return ( 
        <DIV className = "home">
            <Helmet>
                <title>Home | Fresherstrip</title>
            </Helmet>
            <div className = "black-look">
                    <p>Welcome to Fresherstrip,</p>
                    <p id = "say">We offer Babcock University 100 level School of Computing and Engineering Sciences and Mass Comm the steps and location to make your signing process faster.</p>                
            </div>
             
            <Link to = "/SignUp"><button id = "sign-up">Sign Up</button></Link>
            <Link to = "/LogIn"><button id = "log-in">Log In</button></Link>
            <Link to = "/Paypal"><button id = "log-in">Checkout</button></Link>

            {/* <Steps></Steps> */}
            <ScrollToTop></ScrollToTop>
        </DIV>
    );
}
 
export default Home;
